import './index.css'

const Hobbies = ({title}) =>{

    return(
        <div className="square hobbies">
            <h1>{title}</h1>
            <ul>
                <li>20 años</li>
                <li>México</li>
                <li>Estado de México</li>
                <li>Estudiante de Ciencias de la computación</li>
            </ul>
        </div>
    )
}

export default Hobbies;
